  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents stream reaches
  and, where applicable, their tributary systems and lakes named as designated Heritage
  and/or Wild Trout waters in California. The individual waters are proposed by the
  California Department of Fish and Wildlife Heritage and Wild Trout Program, and
  designated by the Fish and Game Commission.This revision (12/10/2015) adds the following
  as designated wild trout waters: Maggie Lakes (Maggie Lake #1) and the Little Kern
  River and its tributaries. This revision also adds the Little Kern River and its
  tributaries as designated heritage trout waters.\",\n\t\"license_title\": null,\n\t\"extras\":
